import { AppBar, Stack, Tab, Tabs } from '@mui/material'
import React, { useState } from 'react'



const Tabswitch = () => {
    const[value,setValue]= useState();
  return (
    <div >
     <Tabs textColor="inherit"indicatorColor="secondary" value={value} onChange={(e,value)=>setValue(value)} sx={{marginLeft:'100px', padding:'20px', marginInline:'50px'}}>
                <Tab label="Source1" />
                <Tab label="Source2"/>
                <Tab label="Source3"/>
            </Tabs>

    </div>
  )
}

export default Tabswitch
